import React from 'react'
import SearchResult from './SearchResult'

class SearchList extends React.Component {
    render() {
        return (
            <div className = "app">
                {this.props.searches.map((search, index) => {
                    return (
                        <SearchResult />
                    )
                })}
            </div>
        );
    }
}
export default SearchList
